import React from "react";
import styled from "styled-components";
import ImageBox from "./ImageBox";
import Image1 from "./sliderSources/Image1";
import Image2 from "./sliderSources/Image2";
import Image3 from "./sliderSources/Image3";
import Text1 from "./sliderSources/Text1";
import Text2 from "./sliderSources/Text2";
import Text3 from "./sliderSources/Text3";
import TextBox from "./TextBox";

const Container = styled.div``;

const ContentsBox = () => {
  return (
    <>
      <ImageBox>
        <Image1 />
      </ImageBox>
      <TextBox>
        <Text1 />
      </TextBox>
    </>
  );
};

export default ContentsBox;
